}

var $bm_rt;
$bm_rt = joySwitch(value);
function joySwitch(resultVal) {
    var theController = thisComp.layer('plane1');
    var switchTemplate = comp('right_ear');
    var theLimit = theController('ADBE Effect Parade')('joystickLimit')('ADBE Slider Control-0001').value;
    var positionRamp = $bm_sum($bm_mul(theController('ADBE Transform Group')('ADBE Position').value, $bm_div(1000, $bm_mul(theLimit, 2))), [
            switchTemplate.width / 2,
            switchTemplate.height / 2,
            0
        ]);
    var switchItems = [];
    for (var x = 1; x <= switchTemplate.numLayers; x++) {
        var separation = length(positionRamp, switchTemplate.layer(x)('ADBE Transform Group')('ADBE Position'));
        var myItem = {
                myLayer: switchTemplate.layer(x),
                myDistance: separation
            };
        switchItems.push(myItem);
    }
    switchItems.sort(function (a, b) {
        if (a.myDistance > b.myDistance) {
            return 1;
        }
        if (a.myDistance < b.myDistance) {
            return -1;
        }
        return 0;
    });
    if (switchItems[0].myLayer._name === thisLayer._name) {
        return resultVal;
    } else {
        return 0;
    }
}
